import { useEffect, useState } from "react";

function Results() {
    const [data, setData] = useState([{}])

    useEffect(() => {
        fetch("/members").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )
    }, [])
    
    return(
        <div className="App" id="results">
        </div>
    );
}

export default Results;
